import { useEffect, useState, useContext } from 'react';
import Button from 'react-bootstrap/Button';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import axios from 'axios';
import { BASEURL } from './baseURL';
import { Card } from 'react-bootstrap';
import { AppContext } from './App';


function DoctorSlotList( {dateTime, setDateTime, slotList, setSlotList} ) {

  const {isDoctor, setIsDoctor} = useContext(AppContext);

  useEffect(()=>{
    axios.get(BASEURL + `/profile/book_slots_list/${isDoctor}`,{
    }).then(function (response) {
      console.log(response.data);
      setSlotList(response.data);
      })
      .catch(function (error) {
        console.log(error);
    });
  }, []);

  return (
    <ul className="list-unstyled">
      {slotList.map((slot) =>
        <li key={slot.id}>
          <Card style={{ width: '18rem' }}>
          <Card.Title>{slot.patientProfile || "TEMP"}</Card.Title>
          <Card.Text>{slot.booking_date}</Card.Text>
          <Card.Text>{slot.start_time}</Card.Text>
          <Card.Text>{slot.end_time}</Card.Text>
          <Button
            variant="primary"
            className="mb-3" 
            type="button"
            onClick={(e) => {
              e.preventDefault();
            }}>
              Call
          </Button>
          </Card>
        </li>
      )}
    </ul>
  )
}

export default DoctorSlotList
